import React , {Component} from "react"
import Card from "./Card"
import {getProducts, getCategery} from "../FakeData/Products"

class Cards extends Component{
    state={
        data: []
    }
    
    async componentDidMount(){
        const {data}= await getProducts()
         this.setState({data})
         console.log(this.state.data)
     }
    render(){
        const {data} = this.state
        const {onDelete, selectedCategery, pageSize, currentPage, onPage} = this.props
        return(
                <Card onDelete={onDelete} data={data} selectedCategery={selectedCategery}
                    pageSize={pageSize} currentPage={currentPage} onPage={onPage}/>

        )
    }
}

export default Cards;
